contracts/AIVerifier.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

/**
 * @title AIVerifier
 * @dev Smart contract interface for AI-embedded gold verification
 * Integrates with NOVA-BLOCKS quantum AI systems
 */
contract AIVerifier is Ownable, ReentrancyGuard {
    // Verification request structure
    struct VerificationRequest {
        address requester;
        uint256 metalType;       // 1 = Gold, 2 = Silver
        uint256 weight;          // Weight in grams
        uint256 purity;          // Purity percentage
        bytes32 sensorDataHash;  // Hash of AI sensor data
        uint256 timestamp;
        bool processed;
        bool approved;
        bytes32 verificationId;
    }

    mapping(bytes32 => VerificationRequest) public requests;
    mapping(address => bool) public authorizedVerifiers;

    uint256 public verificationFee = 0.01 ether;
    uint256 public requestCount;

    // Events
    event VerificationRequested(bytes32 indexed requestId, address indexed requester);
    event VerificationCompleted(bytes32 indexed requestId, bool approved);
    event VerifierAuthorized(address indexed verifier);
    event VerifierRevoked(address indexed verifier);

    constructor() {
        authorizedVerifiers[msg.sender] = true;
    }

    /**
     * @dev Request AI verification for precious metal
     */
    function requestVerification(
        uint256 _metalType,
        uint256 _weight,
        uint256 _purity,
        bytes32 _sensorDataHash
    ) external payable nonReentrant returns (bytes32) {
        require(msg.value >= verificationFee, "Insufficient verification fee");
        require(_metalType == 1 || _metalType == 2, "Invalid metal type");
        require(_weight > 0, "Weight must be positive");
        require(_purity >= 900 && _purity <= 1000, "Invalid purity range");

        bytes32 requestId = keccak256(abi.encodePacked(
            msg.sender,
            _metalType,
            _weight,
            _purity,
            _sensorDataHash,
            block.timestamp,
            requestCount
        ));

        requests[requestId] = VerificationRequest({
            requester: msg.sender,
            metalType: _metalType,
            weight: _weight,
            purity: _purity,
            sensorDataHash: _sensorDataHash,
            timestamp: block.timestamp,
            processed: false,
            approved: false,
            verificationId: bytes32(0)
        });

        requestCount++;
        emit VerificationRequested(requestId, msg.sender);

        return requestId;
    }

    /**
     * @dev Submit AI verification result (only authorized verifiers)
     */
    function submitVerification(
        bytes32 _requestId,
        bool _approved,
        bytes32 _verificationId
    ) external {
        require(authorizedVerifiers[msg.sender], "Not authorized verifier");

        VerificationRequest storage request = requests[_requestId];
        require(!request.processed, "Request already processed");
        require(request.requester != address(0), "Request does not exist");

        request.processed = true;
        request.approved = _approved;
        request.verificationId = _verificationId;

        emit VerificationCompleted(_requestId, _approved);
    }

    /**
     * @dev Authorize a new AI verifier
     */
    function authorizeVerifier(address _verifier) external onlyOwner {
        authorizedVerifiers[_verifier] = true;
        emit VerifierAuthorized(_verifier);
    }

    /**
     * @dev Revoke verifier authorization
     */
    function revokeVerifier(address _verifier) external onlyOwner {
        authorizedVerifiers[_verifier] = false;
        emit VerifierRevoked(_verifier);
    }

    /**
     * @dev Update verification fee
     */
    function setVerificationFee(uint256 _fee) external onlyOwner {
        verificationFee = _fee;
    }

    /**
     * @dev Withdraw accumulated fees
     */
    function withdrawFees() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No fees to withdraw");
        payable(owner()).transfer(balance);
    }

    /**
     * @dev Get verification request details
     */
    function getVerificationRequest(bytes32 _requestId) external view returns (
        address requester,
        uint256 metalType,
        uint256 weight,
        uint256 purity,
        bytes32 sensorDataHash,
        uint256 timestamp,
        bool processed,
        bool approved,
        bytes32 verificationId
    ) {
        VerificationRequest memory request = requests[_requestId];
        return (
            request.requester,
            request.metalType,
            request.weight,
            request.purity,
            request.sensorDataHash,
            request.timestamp,
            request.processed,
            request.approved,
            request.verificationId
        );
    }
}

contracts/GodNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

/**
 * @title GodNFT
 * @dev ERC-721 NFT certificates for precious metal ownership
 * Represents physical gold/silver certificates backed by AI verification
 */
contract GodNFT is ERC721, Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIdCounter;

    // NFT metadata
    struct MetalCertificate {
        uint256 metalType;       // 1 = Gold, 2 = Silver
        uint256 weight;          // Weight in grams
        uint256 purity;          // Purity in percentage (999 = 99.9%)
        string serialNumber;     // Unique serial number
        uint256 mintDate;        // Timestamp of minting
        bytes32 aiVerification;  // AI verification hash
        bool redeemed;           // Whether certificate has been redeemed
    }

    mapping(uint256 => MetalCertificate) public certificates;

    // Events
    event CertificateMinted(uint256 indexed tokenId, address indexed owner, uint256 metalType, uint256 weight);
    event CertificateRedeemed(uint256 indexed tokenId, address indexed redeemer);

    constructor() ERC721("GOD Precious Metal Certificate", "GODNFT") {}

    /**
     * @dev Mint a new precious metal certificate NFT
     */
    function mintCertificate(
        address _to,
        uint256 _metalType,
        uint256 _weight,
        uint256 _purity,
        string memory _serialNumber,
        bytes32 _aiVerification
    ) external onlyOwner returns (uint256) {
        require(_metalType == 1 || _metalType == 2, "Invalid metal type");
        require(_weight > 0, "Weight must be positive");
        require(_purity >= 900 && _purity <= 1000, "Invalid purity");

        _tokenIdCounter.increment();
        uint256 tokenId = _tokenIdCounter.current();

        certificates[tokenId] = MetalCertificate({
            metalType: _metalType,
            weight: _weight,
            purity: _purity,
            serialNumber: _serialNumber,
            mintDate: block.timestamp,
            aiVerification: _aiVerification,
            redeemed: false
        });

        _mint(_to, tokenId);

        emit CertificateMinted(tokenId, _to, _metalType, _weight);
        return tokenId;
    }

    /**
     * @dev Redeem a certificate (burn NFT and trigger physical delivery)
     */
    function redeemCertificate(uint256 _tokenId) external {
        require(ownerOf(_tokenId) == msg.sender, "Not the owner");
        require(!certificates[_tokenId].redeemed, "Already redeemed");

        certificates[_tokenId].redeemed = true;

        // Burn the NFT
        _burn(_tokenId);

        emit CertificateRedeemed(_tokenId, msg.sender);
    }

    /**
     * @dev Get certificate details
     */
    function getCertificate(uint256 _tokenId) external view returns (
        uint256 metalType,
        uint256 weight,
        uint256 purity,
        string memory serialNumber,
        uint256 mintDate,
        bytes32 aiVerification,
        bool redeemed
    ) {
        MetalCertificate memory cert = certificates[_tokenId];
        return (
            cert.metalType,
            cert.weight,
            cert.purity,
            cert.serialNumber,
            cert.mintDate,
            cert.aiVerification,
            cert.redeemed
        );
    }

    /**
     * @dev Get token URI for metadata
     */
    function tokenURI(uint256 tokenId) public view override returns (string memory) {
        require(_exists(tokenId), "Token does not exist");

        MetalCertificate memory cert = certificates[tokenId];
        string memory metalName = cert.metalType == 1 ? "Gold" : "Silver";

        // In a real implementation, this would return IPFS/Arweave metadata
        return string(abi.encodePacked(
            "https://api.god-token-coin.com/metadata/",
            Strings.toString(tokenId),
            "?metal=",
            metalName,
            "&weight=",
            Strings.toString(cert.weight),
            "&purity=",
            Strings.toString(cert.purity)
        ));
    }
}

contracts/GodStaking.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title GodStaking
 * @dev Staking contract for GOD tokens with precious metal rewards
 */
contract GodStaking is ReentrancyGuard, Ownable {
    IERC20 public godToken;

    struct Stake {
        uint256 amount;
        uint256 startTime;
        uint256 lastClaimTime;
        bool active;
    }

    mapping(address => Stake) public stakes;
    mapping(address => uint256) public rewards;

    // Staking parameters
    uint256 public constant REWARD_RATE = 10; // 10% APY base rate
    uint256 public constant LOCK_PERIOD = 30 days;
    uint256 public totalStaked;

    // Events
    event Staked(address indexed user, uint256 amount);
    event Unstaked(address indexed user, uint256 amount);
    event RewardClaimed(address indexed user, uint256 amount);

    constructor(address _godToken) {
        godToken = IERC20(_godToken);
    }

    /**
     * @dev Stake GOD tokens
     */
    function stake(uint256 _amount) external nonReentrant {
        require(_amount > 0, "Cannot stake 0 tokens");
        require(godToken.transferFrom(msg.sender, address(this), _amount), "Transfer failed");

        Stake storage userStake = stakes[msg.sender];

        if (userStake.active) {
            // Claim existing rewards before restaking
            _claimRewards(msg.sender);
            userStake.amount += _amount;
        } else {
            userStake.amount = _amount;
            userStake.startTime = block.timestamp;
            userStake.lastClaimTime = block.timestamp;
            userStake.active = true;
        }

        totalStaked += _amount;
        emit Staked(msg.sender, _amount);
    }

    /**
     * @dev Unstake GOD tokens (after lock period)
     */
    function unstake() external nonReentrant {
        Stake storage userStake = stakes[msg.sender];
        require(userStake.active, "No active stake");
        require(block.timestamp >= userStake.startTime + LOCK_PERIOD, "Lock period not ended");

        uint256 amount = userStake.amount;

        // Claim final rewards
        _claimRewards(msg.sender);

        // Reset stake
        userStake.active = false;
        userStake.amount = 0;
        totalStaked -= amount;

        require(godToken.transfer(msg.sender, amount), "Transfer failed");
        emit Unstaked(msg.sender, amount);
    }

    /**
     * @dev Claim staking rewards
     */
    function claimRewards() external nonReentrant {
        _claimRewards(msg.sender);
    }

    /**
     * @dev Internal function to calculate and claim rewards
     */
    function _claimRewards(address _user) internal {
        Stake storage userStake = stakes[_user];
        if (!userStake.active) return;

        uint256 reward = calculateRewards(_user);
        if (reward > 0) {
            userStake.lastClaimTime = block.timestamp;
            rewards[_user] = 0;
            // In reality, mint new tokens or transfer from reward pool
            require(godToken.transfer(_user, reward), "Reward transfer failed");
            emit RewardClaimed(_user, reward);
        }
    }

    /**
     * @dev Calculate pending rewards for a user
     */
    function calculateRewards(address _user) public view returns (uint256) {
        Stake memory userStake = stakes[_user];
        if (!userStake.active) return 0;

        uint256 timeElapsed = block.timestamp - userStake.lastClaimTime;
        uint256 reward = (userStake.amount * REWARD_RATE * timeElapsed) / (365 days * 100);

        return reward;
    }

    /**
     * @dev Get stake information
     */
    function getStakeInfo(address _user) external view returns (
        uint256 amount,
        uint256 startTime,
        uint256 lastClaimTime,
        uint256 pendingRewards,
        bool active
    ) {
        Stake memory userStake = stakes[_user];
        uint256 pending = calculateRewards(_user);

        return (
            userStake.amount,
            userStake.startTime,
            userStake.lastClaimTime,
            pending,
            userStake.active
        );
    }
}

